BlocklyGamesMsg["Turtle.helpText4a"] = "Սա նոր բլոկ է, որը թույլ է տալիս բարձրացնել գրիչը թղթից շարժման ժամանակ.";
BlocklyGamesMsg["Turtle.helpText4b"] = "Նկարիր փոքր դեղին աստղ, ապա նկարիր գիծ նրա վերևը:";
BlocklyGamesMsg["Turtle.helpText5"] = "Մեկ աստղի փոխարեն կարո՞ղ ես նկարել չորս աստղ քառակուսու անկյուններում:";
BlocklyGamesMsg["Turtle.helpText6"] = "Նկարիր երեք դեղին աստղ և մեկ սպիտակ գիծ:";
