BlocklyGamesMsg["Turtle.helpText8"] = "Նկարված 360 հատ սպիտակ գծերը ունենալու են լիալուսնի տեսք:";
BlocklyGamesMsg["Turtle.helpText9"] = "Կարո՞ղ ես ավելացնել սև շրջան այնպես, որ լուսինը դառնա կիսալուսին:";
