BlocklyGamesMsg["Turtle.helpText10Reddit"] = "Օգտագործիր \"Տեսնել Պատկերասրահը\" կոճակը այլոց աշխատանքները տեսնելու համար։ Եթե դու որևէ հետաքրքիր բան ես կատարել, օգտագործիր \"Պահպանել պատկերասրահում\" կոճակը, որպիսի քո աշխատանքը նաև ուրիշները տեսնեն։";
