BlocklyGamesMsg["Movie.helpText1"] = "Օգտագործիր պարզ պատկերներ մարդուկին գծելու համար։";
BlocklyGamesMsg["Movie.helpText2a"] = "Այս մակարդակը իրենից ներկայացնում է ֆիլմ։ Պահանջվում է, որ ձեռքը շարժվի էկրանով։ Սեղմիր «Սկիզբ» կոճակը տեսնելու համար։";
BlocklyGamesMsg["Movie.helpText2b"] = "Ֆիլմի դիտման ժամանակ \"ժամանակ\" բլոկի արժեքը փոփոխվում է սկսած 0֊ից մինչև 100։ Հեշտ է, որովհետև ձեռքի \"y\"-ը կորդինատը պիտի փոխվի 0֊ից 100։";
BlocklyGamesMsg["Movie.helpText3"] = "\"ժամանակ\" բլոկը հաշվում է 0֊ից մինչև 100։ Սակայն հիմա մյուս ձեռքի \"y\" կոդինատը պիտի սկսվի 100֊ից և ավարտվի 0֊ով։ Կարո՞ղ ես մտածել պարզ մաթեմատիկական բանաձև, որը կօգնի լուծել այս խնդիրը։";
BlocklyGamesMsg["Movie.helpText4"] = "Օգտագործի նախորդ մակադակում սովորածդ ոտքերը խաչաձևելու համար։";
BlocklyGamesMsg["Movie.helpText5"] = "Ձեռքի համար բանաձևը հեշտ չէ, ահա լուծումը՝";
