BlocklyGamesMsg["Movie.helpText7"] = "Օգտագործիր «եթե» բլոկը տեսանյութի առաջին մասի փոքր գլուխը նկարելու համար։ Հետո նկարիր մեծ գլուխը ֆիլմի երկրորդ մասի համար։";
BlocklyGamesMsg["Movie.helpText8"] = "Այնպես արա, որ ոտքերը հակառակ հաջորդականությամբ լինեն տեսանյութի կեսում։";
