BlocklyGamesMsg["Music.helpUseFunctions"] = "Քո լուծումը աշխատում է, բայց կարող ես ավելի լավ անել: Կիրառիր ֆունկցիաներ կրկնվող կոդի քանակը կրճատելու համար:";
