BlocklyGamesMsg["Music.helpText2b"] = "Ստեծիր ֆունկցիա, որը կնվագի «Frère Jacques»֊ի առաջին 4 նոտաները։ Գործարկիր այն 2 անգամ։ Մի՛ ավելացրու նոտաների հավելյալ բլոկներ։";
