BlocklyGamesMsg["Music.helpText6a"] = "Այս նոր բլոկը նոր գործիք վերցնելու համար է։";
BlocklyGamesMsg["Music.helpText6b"] = "Նվագիր քո մեղեդին ջութակի վրա:";
BlocklyGamesMsg["Music.helpText7a"] = "Այս բլոկը ավելացնում է լուռ ընդհատում։";
BlocklyGamesMsg["Music.helpText7b"] = "Ստեղծիր սկզբի 2֊րդ բլոկը, որը կունենա դադարի 2 բլոկներ, ապա նվագիր «Frère Jacques»֊ը։";
BlocklyGamesMsg["Music.helpText8"] = "Յուրաքանչյուր սկզբի բլոկ պիտի «Frère Jacques»֊ը կրկնակի նվագի։";
BlocklyGamesMsg["Music.helpText9"] = "Ստեղծիր 4 սկզբի բլոկ։ Յուրաքանչյուրը պիտի 2 անգամ նվագի «Frère Jacques»֊ը։ Ավելացրու ճիշտ քանակով դադարի բլոկներ։";
BlocklyGamesMsg["Music.helpText10"] = "Նվագիր այն, ինչ ցանկանում ես: Դու ունես մեծ քանակությամբ նոր բլոկներ, որոնք կարող ես ուսումնասիրել: Զվարճացիր:";
BlocklyGamesMsg["Music.helpText10Reddit"] = "Օգտագործիր \"Տեսնել Պատկերասրահը\" կոճակը այլոց աշխատանքները տեսնելու համար։ Եթե դու որևէ հետաքրքիր բան ես կատարել, օգտագործիր \"Պահպանել պատկերասրահում\" կոճակը, որպիսի քո աշխատանքը նաև ուրիշները տեսնեն։";
BlocklyGamesMsg["Pond.scanTooltip"] = "Որոնում է թշնամիներին։ Նշիր ուղղությունը (0-360): Վերադարձնում է մոտակա թշնամու հեռավորությունը տվյալ ուղղությամբ։ Վերադարձնում է անվերջություն, եթե թշնամի չի գտնվել։";
BlocklyGamesMsg["Pond.cannonTooltip"] = "Կրակել թնդանոթից։ Նշիր ուղղությունը(0-360) և հեռավորությունը (0-70)։";
BlocklyGamesMsg["Pond.swimTooltip"] = "Լողալ առաջ: Նշիր ուղղությունը (0-360):";
BlocklyGamesMsg["Pond.stopTooltip"] = "Դադարեցնել լողալը։ Խաղացողը կկանգնի դանդաղելով։";
BlocklyGamesMsg["Pond.healthTooltip"] = "Վերադարձնում է խաղացողի ներկա առողջությունը (0֊ն մահացած է, 100֊ը առողջ):";
BlocklyGamesMsg["Pond.speedTooltip"] = "Վերադարձնում է խաղացողի ընթացիք արագությունը (0 անշարժ է, 100 մաքսիմալ արագություն):";
BlocklyGamesMsg["Pond.locXTooltip"] = "Վերադարձնում է խաղացողի X կոորդինատը (0-ն ձախ եզրն է, 100-ը՝ աջ եզրը):";
BlocklyGamesMsg["Pond.locYTooltip"] = "Վերադարձնում է խաղացողի Y կոորդինատը (0-ն ստորին եզրն է, 100-ը՝ վերին եզրը):";
BlocklyGamesMsg["Pond.logTooltip"] = "Տպում է համարը Ձեր զննարկիչի վահանակում:";
BlocklyGamesMsg["Pond.docsTooltip"] = "Ցուցադրում է լեզվի ձեռնարկը։";
BlocklyGamesMsg["Pond.documentation"] = "Ձեռնարկ";
BlocklyGamesMsg["Pond.playerName"] = "Խաղացող";
BlocklyGamesMsg["Pond.targetName"] = "Նպատակ";
BlocklyGamesMsg["Pond.pendulumName"] = "Ճոճանակ";
BlocklyGamesMsg["Pond.scaredName"] = "Վախեցած";
BlocklyGamesMsg["Pond.helpUseScan"] = "Քո լուծումը աշխատում է, սակայն կարելի է ավելի լավ անել։ Օգտագործիր 'scan', թնդանոթի կրակի հեռավորությունը նշելու համար։";
BlocklyGamesMsg["Pond.helpText1"] = "Օգտագործիր 'cannon' հրամանը թիրախը խոցելու համար։ Առաջին պարամետրը անկյունն է, երկրորդը ՝ հեռավորությունը։ Գտիր ճիշտ համատեղությունը։";
BlocklyGamesMsg["Pond.helpText2"] = "Այս թիրը պետք է խոցել մի քանի անգամ։ Օգտագործիր \"քանի դեռ(ճշմարիտ է)\" հանգույցը որևէ բան անվերջ անելու համար։";
BlocklyGamesMsg["Pond.helpText3a"] = "Այս հակառակորդը շարժվում է առաջ֊հետ։ Այդ պատճառով դժվար խոցելի է։ \"Scan\" արտահայտությունը վերադարձնում է նշված ուղղությամբ մինչ հակառակորդը ընկած ճշգրիտ հեռավորությունը։";
BlocklyGamesMsg["Pond.helpText3b"] = "Հեռավորությունը անրհաժեշտ է թնդանոթին ճիշտ կրակելու համար։";
BlocklyGamesMsg["Pond.helpText4"] = "Այս թշնամին շատ հեռու է թնդանոթի համար (սահմանափակումն է 70 մետր)։ Կրակելու փոխարեն օգտագործիր «swim» հրամանը, որպիսի լողալով բախվես նրա հետ։";
BlocklyGamesMsg["Pond.helpText5"] = "Այս թշնամին նույնպես հեռու է թնդանոթը օգտագործելու համար։ Սակայն դու էլ չափազանց թույլ ես բախման համար։ Լողա քանի դեռ քո հորիզոնական դիրքը 50֊ից փոքր է, ապա կանգնիր և օգտագործիր թնդանոթը։";
BlocklyGamesMsg["Pond.helpText6"] = "Այս թշնամին կլողա խոցվելուց հետո։ Լողա առաջ, եթե այն գտնվում է խոցման տիրույթից դուրս (70 մետր)։";
BlocklyGamesMsg["Gallery"] = "Պատկերասրահ";
